import React from "react";
import "./Menu.css";
// import { pizzas } from "../../storage/pizzaMenu";

//Import Components
import Navbar from "../../components/Navbar/Navbar";
import Card from "../../components/Card/Card";
import Footer from "../../components/Footer/Footer";

const Menu = () => {
  const pizzas = [
    {
      name: "pepperoni",
      ingredients: "blah",
    },
    {
      name: "pepperoni",
      ingredients: "blah",
    },
    {
      name: "pepperoni",
      ingredients: "blah",
    },
  ];

  return (
    <>
      <Navbar />
      <div className="cardContainer">
        {pizzas.map((pizza: any, key: any) => {
          return <Card name={pizza.name} ingredients={pizza.ingredients} />;
        })}
      </div>
      <Footer />
    </>
  );
};

export default Menu;
